import axios from "axios";

export const fetchDriveImages = async (driveLink) => {
  try {
    const response = await axios.get(`YOUR_BACKEND_ENDPOINT/fetch-drive-images`, { params: { driveLink } });
    return response.data.images; // Assuming backend returns images array
  } catch (error) {
    console.error("Error fetching images:", error);
    return [];
  }
};
